import React, {Component} from 'react'
import {Navbar, Button, Nav,} from 'react-bootstrap';
import { LinkContainer } from "react-router-bootstrap";
import { Input , Icon} from 'semantic-ui-react'
import axiosInstance from "../User/axiosApi";

class NavBar extends Component {

    constructor() {
      super();
      this.handleLogout = this.handleLogout.bind(this);
    }

    async handleLogout() {
      try {
        const response = await axiosInstance.post('logout/', {
          "refresh_token": localStorage.getItem("refresh_token")
        });
        localStorage.removeItem("access_token");
        localStorage.removeItem("refresh_token");
        axiosInstance.defaults.headers['Authorization'] = null; 
        return response; 
      }
      catch (e) {
        console.log(e);
      }
    }

    render() {
      return (
        <div>
            <Navbar bg="primary" variant="dark" fixed="top">
              <Navbar.Brand href="#home" className="pr-3">MatchMe</Navbar.Brand>
              <Nav className="mr-auto">
                <LinkContainer to="/">
                  <Nav.Link >Actions</Nav.Link>
                </LinkContainer>
                <LinkContainer to="/feed">
                  <Nav.Link >Groups</Nav.Link>
                </LinkContainer>
              </Nav>
              <Input icon='search' placeholder='Search...' style={{right: 60}}/>
              <LinkContainer to="/profile" style={{height: 40}}>
                <Nav.Link><Icon name="user circle" style={{color: "white", fontSize: 35, marginLeft: 10, position: "fixed", top: 3, right: 25}}/></Nav.Link>
              </LinkContainer>
            </Navbar>
            <div style={{paddingTop: 100}}></div>
        </div>
    );
    }
}

{/* <button onClick={this.handleLogout}>Logout</button> */}

export default NavBar;
